import { Card, Avatar } from 'antd';


const { Meta } = Card;

const gridStyle = {
  textAlign: 'center',
};

function Account() {
  return <>
    

    <Card
      style={{ width: 300 }}
      cover={
        <img
          alt="example"
          src="https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png"
        />
      }
     
    >
      <Meta
        title="Card title"
        description="This is the description"
      />
    </Card>

  </>;
}

export default Account;
